<template>
<div id="home" class="container mt-5">
    <div class="row justify-content-center">
        <div class="col-md-6">
            <div class="card card-body">
                <div class="form-group">
                    <v-layout row wrap>
                        <!-- <v-flex sm10 offset-sm1 v-for="role in user.roles" :key="role.id" v-if="role.name === 'Admin'">
                            <v-select :items="AllClients" v-model="form.client" hint="Client" label="Filter By Client" single-line item-text="name" item-value="id" return-object persistent-hint></v-select>
                        </v-flex> -->
                        <v-flex sm10 offset-sm1>
                            <div class="form-group col-md-12">
                                <option value=""></option>
                                <label class="col-form-label text-md-right" for="">Clients</label>
                                <select class="custom-select custom-select-md col-md-12" v-model="form.client">
                                    <option value=""></option>
                                    <option v-for="client in AllClients" :key="client.id" :value="client.id">{{ client.name }}</option>
                                </select>
                            </div>
                        </v-flex>
                        <v-flex xs12 sm5 offset-sm1>
                            <v-text-field v-model="form.start_date" :type="'date'" color="blue darken-2" label="Start Date" required></v-text-field>
                        </v-flex>
                        <v-flex xs12 sm5 offset-sm1>
                            <v-text-field v-model="form.end_date" :type="'date'" color="blue darken-2" label="End Date" required></v-text-field>
                        </v-flex>
                    </v-layout>
                </div>
                <v-btn raised color="primary" @click="filterInvoice" :disabled="loading" :loading="loading">Download Invoces</v-btn>
            </div>
        </div>
    </div>
</div>
</template>

<script>
import jspdf from "jspdf";
import VueBarcode from "vue-barcode";

export default {
    props: ['user'],
    name: "print",
    components: {
        barcode: VueBarcode
    },
    data() {
        return {
            name: "",
            AllClients: [],
            invoices: [],
            form: {},
            errors: [],
            loading: false
        };
    },

    mounted() {
        this.getCustomer()
    },
    methods: {
        filterInvoice() {
            this.loading = true;
            axios
                .post("/filterInvoice", this.$data.form)
                .then(response => {
                    this.loading = false;
                    this.invoices = response.data;
                    this.download();
                })
                .catch(error => {
                    this.loading = false;
                    this.errors = error.response.data.errors;
                });
        },
        getCustomer() {
            this.loading = true
            axios.get('/getCustomer')
                .then((response) => {
                    this.loader = false
                    this.loading = false
                    this.AllClients = response.data
                })
                .catch((error) => {
                    this.loader = false
                    this.loading = false
                    this.errors = error.response.data.errors
                })
        },
        download() {
            let pdfName = "Boxleo";
            var doc = new jspdf();
            // doc.text(this.name, 10, 10);
            var doc = new jspdf();

            var imgData = "data:image/jpeg;base64,";

            for (let i = 0; i < this.invoices.length; i++) {
                doc.addImage(imgData, 20, 5, 50, 40);
                doc.setFontSize(12);

                const element = this.invoices[i];
                doc.setFont("times");
                doc.setFontType("normal");
                // console.log(this.element)
                doc.text(130, 15, "Order Date:  " + element['created_at']);
                doc.text(130, 25, "Delivery Date:  " + element['derivery_date']);

                // console.log(this.element)
                doc.text(20, 50, "Address:  " + element['sender_address']);
                doc.text(20, 60, "City: " + element['sender_city']);
                doc.text(20, 70, "Phone Number:  " + element['sender_phone']);

                // console.log(this.element)
                doc.text(130, 40, "WayBill Number:  " + element['bar_code']);
                doc.text(130, 47, "Client Name:  " + element['client_name']);
                doc.text(130, 54, "Client Address:  " + element['client_address']);
                doc.text(130, 61, "Client City:  " + element['client_city']);
                doc.text(130, 68, "Client Phone:  " + element['client_phone']);
                //   doc.line(140, 50, 140, 200); // vertical line

                // Product
                doc.rect(18, 80, 170, 10);
                doc.setFontSize(14);
                doc.text(100, 85, "Product Details", null, null, "center");
                doc.setFontSize(12);
                doc.rect(18, 90, 170, 10);
                doc.text(20, 95, "Product Description");
                doc.text(80, 95, "Price", null, null, "left");
                doc.text(150, 95, "Quantity", null, null, "left");

                doc.rect(18, 100, 170, 15);
                //   doc.line(70, 100, 70, 130); // vertical line
                //   doc.line(140, 100, 140, 130); // vertical line
                doc.text(20, 105, "" + element['bar_code']);
                doc.text(80, 105, "" + element['cod_amount'], null, null, "left");
                doc.text(150, 105, "" + element['amount_ordered'], null, null, "left");

                // Lines

                // doc.addPage()

                doc.addPage();
            }
            if (this.invoices.length > 0) {
                doc.save(pdfName + ".pdf");
            } else {
                eventBus.$emit('errorEvent', 'No data found')
                return
            }
        }
    },
    mounted() {
        this.getCustomer()
    }
};
</script>
